    null,nt"notes": "nA prototype Web Map Service (WMS) displaying NOAA National
    Weather Service short duration weather warning polygons.  The data are updated on
    five minute intervals.  Note: this service displays only the 'polygonal' warnings
    for severe weather events (flash flood warnings, severe thunderstorm warnings, special
    marine warnings, and tornado warnings), it does not include other watches or hazards
    that may be active in a particular area.nnFor full information about active warnings,
    watches, hazards, and alerts, please see the National Weather Service page at: http://www.nws.noaa.gov/view/largemap.php.nnSource
    data for this service can be found here: http://www.nws.noaa.gov/gis/shapepage.htm.nnThis
    is a prototype service available on NOAA's Open Geospatial Consortium shared hosting
    service.  The hosting system is monitored for uptime and is geographically distributed
    in a high-availability architecture with two mirrored nodes.  However, it should
    not be relied upon for 24 x 7 uptime for emergency response.ntttt",nt"license_title":
